import React, { Component } from "react";

import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {};
  }
  render() {
    return (
      <div className="container">
        <header className="header">header</header>
        <div className="content">content</div>
        <footer className="footer">footer</footer>
      </div>
    );
  }
}

export default App;
